  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Calhoun National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1947. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife including migratory birds, furbearers,
  and fish is also covered. The Refuge development and maintenance section discusses
  physical developments. The public relations section of the report describes Refuge
  visitors, hunting, and violations. NR forms and photographs are attached.\",\n\t\"license_title\":
